import React from "react";

export const Gallery = (props) => {
  const { view } = props;

  return (
    <div className="galleryView">
      <>
        {view
        // .filter((item) => item.lens === "Fujifilm 35mm f/1.4") // filters only photos with this lens
        .map((item) => (
          <ul>
            <>
              <img src={item.image} alt="test" />
              <li>{item.camera}</li>
              <li>{item.lens}</li>
              <li>{item.date}</li>
              <li>{item.location}</li>
            </>
          </ul>
        ))}
      </>
    </div>
  );
};
export default Gallery;
